	(2,'# Working with APIs #\r\n','API Landing Page General Info','markdown'),
	(3,'<div class=\"contentsection\"><div class=\"tabheading\"><div class=\"inner\">Authentication</div></div><p>The API use application keys for authetication. To get an API key, please <a name=\"register\"></a>register</p></div><div class=\"contentsection\"><div class=\"tabheading\"><div class=\"inner\">Rate Limiting</div></div><p>The API calls are rate limied to 10 per minute.</p></div><div class=\"contentsection\"><div class=\"tabheading\"><div class=\"inner\">Known Issues</div></div><p>Please visit forum to see the list of <a name=\"known issues\"></a>known issues</p></div><div class=\"contentsection\"><div class=\"tabheading\"><div class=\"inner\">Terms of Use</div></div><p>The use of these API are governed by<a name=\"terms of use\"></a> <a>Terms of Use</a>.</p></div>','Commen APIs','full_html'),
	(4,'<?php global $base_url; ?>\r\n<style>\r\n.column {float:left;width:240px;padding:0 10px 6px 14px;}\r\n#block-block-4 { border-top: 1px solid #dfdfdf; }\r\n</style>\r\n\r\n<div id=\"col1\" class=\"column\">\r\n    <h4><a href=\"/apis\">Explore</a></h4>\r\n    <div class=\"column-cta\">Explore Our APIs</div>\r\n    <p>Explore the API provided by Aloha .. from customer information API, to current \'Search\' API</p>\r\n</div>\r\n<div id=\"col2\" class=\"column\">\r\n    <h4><a href=\"/user/register\">Register</a></h4>\r\n    <div class=\"column-cta\">Register for an Account</div>\r\n    <p>You need to register for an account use the APIs. Or use OpenId to use your Facebook, Google, Yahoo, or Microsoft account.</p>\r\n</div>\r\n<div id=\"col3\" class=\"column\">\r\n   <h4><a href=\"/faq-page\">Learn</a></h4>\r\n   <div class=\"column-cta\">Discuss & Learn</div>\r\n <p> Get in touch with the Namaste API team and developer community. See if an issue has already been discussed in our forums.</p>\r\n</div>','home_page_columns','php_code'),
