INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`)
VALUES
	('node','page',0,3,3,'und',0,'<iframe src=\"https://apigee.com/enterprisestickers/embed/console/estickers?v=2\" width=\"100%\" height=\"600\" scrolling=\"no\"></iframe>','','full_html'),
	('node','page',0,54,54,'und',0,'		<h2 style=\"font-size: 3.6em; font-weight: normal; line-height: 1.2; color: #3c3c3c; font-family: helvetica, Arial, sans-serif;\">\r\n			Welcome to the <b><?php echo $GLOBALS[\'conf\'][\'site_name\']; ?></b>\r\n		</h2>\r\n		<h3 style=\"font-size: 2.2em; font-weight: normal; line-height: 1.2; color: #ff4000; font-family: helvetica, Arial, sans-serif; text-align: left;\">\r\n			Providing support for the API Development Community\r\n		</h3>\r\n		<p style=\"padding-right: 275px; font-size: 1.2em;  line-height: 1.5; font-family: helvetica, Arial, sans-serif; text-align: left; border-width: 0px;\">\r\n			NamasteCRM provides open API to access Namaste\'s product catalog, featuring full product description (with image), pricing and availability. One can also search for \'Discounts\' across range of product categories. These API can also be used to locate Acme stores in a town/city.\r\n		</p>\r\n		<p>\r\n			<a class=\"btn primary\" href=\"/api-method/create-api-product-0\">Learn More</a>\r\n		</p>\r\n','','full_html'),
	('node','blog',0,188,188,'und',0,'__Blogs__ are everywhere.  Use this as a vehicle to communicate with your development community.  \r\n\r\nPost information about current and upcoming releases, events, roadmaps, etc...\r\n\r\nEncourage Developer Participation','','markdown'),
	('node','api_reference',1,936,936,'und',0,'<p><span style=\"font-size: 13px; line-height: 20px; \">Apigee Enterprise collects default information as data passes through </span>Apigee Analytics.&nbsp;<span style=\"font-size: 13px; line-height: 20px; \"> The data includes API call information (like URL, IP, and User id) latency, errors, and so on. You can add other information by using policies. For example, data can be collected from message headers, query parameters, portions of the request and response extracted from XML or JSON. &nbsp;This information is used to generate several out-of-the-box reports. You can also generate reports tailored to your needs by tracking key value pairs specific to your traffic. </span></p><p>&nbsp;</p><p>Apigee Analytics helps you to view long-term usage trends. You can segment your audience by top developers and apps. You can understand the usage by using the API method to know where to invest, and create custom reports on business-level information.</p><p>&nbsp;</p><p>All data is pushed to Analytics where it is persisted by the Analytics server in the background. Data aggregation jobs compile various built-in or custom reports:</p><ul><li>Usage by API (built-in)</li><li>Usage by app (built-in)</li><li>Usage developer (built-in)</li><li>Usage by API Traffic (built-in)</li><li>Usage by API Product (built-in)</li><li>Usage by Environment (built-in)</li><li>Usage by Customizing the API</li></ul><p>&nbsp;</p>','','full_html'),
	('node','api_reference',1,936,937,'und',0,'<p>Apigee Enterprise collects default information as data passes through Apigee Analytics.&nbsp; The data includes API call information (like URL, IP, and User id) latency, errors, and so on. You can add other information by using policies. For example, data can be collected from message headers, query parameters, portions of the request and response extracted from XML or JSON. &nbsp;This information is used to generate several out-of-the-box reports. You can also generate reports tailored to your needs by tracking key value pairs specific to your traffic. &nbsp;Apigee Analytics helps you to view long-term usage trends. You can segment your audience by top developers and apps. You can understand the usage by using the API method to know where to invest, and create custom reports on business-level information.&nbsp;All data is pushed to Analytics where it is persisted by the Analytics server in the background. Data aggregation jobs compile various built-in or custom reports:</p><ul><li>Usage by API (built-in)</li><li>Usage by app (built-in)</li><li>Usage developer (built-in)</li><li>Usage by API Traffic (built-in)</li><li>Usage by API Product (built-in)</li><li>Usage by Environment (built-in)</li><li>Usage by Customizing the API</li></ul>','','full_html'),
	('node','api_reference',1,937,938,'und',0,'<p>[toc]</p>\r\n<p>The API generates reports based on the organization, environment which uses the APIs. Each of these reports gives you various filters as well as view options. The Apigee Enterprise landing page displays the analytics for all API traffic, top-k APIs and top-k API resources.</p>\r\n<h2><a class=\"jumplink\" name=\"Getting details on all API traffic\"></a>Getting details on all APIs</h2>\r\n<p>Use the <span style=\"font-family:courier new,courier,monospace;\">GET</span> method to retrieve the metrics for all the available APIs for a given customer in a specific organization and environment. All API traffic displays the total volume, total daily throughput over the last 3 months for all APIs in the account.</p>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" dir=\"ltr\" style=\"height: 261px; width: 708px;\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">URI</th>\r\n			<th scope=\"col\">HTTP method</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<p>GET&nbsp;https://api.enterprise.apigee.com/v1/o/{myorg}/environments/{envname}/analytics/stats/default/apis?select={metrics}&amp;timeRange={startDate~endDate}&amp;timeUnit={unit}&amp;sortby={metrics}&amp;sort={order}</p>\r\n				<p>where:</p>\r\n				<ul>\r\n					<li>organizations - name of the organization</li>\r\n					<li>environments - name of the environment</li>\r\n					<li>default - indicates the wireframe report supported out of the box</li>\r\n					<li>apis - the namespace to indicate API based requests</li>\r\n					<li>select - choose the required metrics</li>\r\n					<li>timeRange - the start and end date (mm/dd/yyyy hh:mm)</li>\r\n					<li>timeUnit - indicates the interval by which the response datat is grouped by</li>\r\n					<li>sortby - column to sort by</li>\r\n					<li>sort - categorize the report by arranging them in either ascending or descending</li>\r\n					<li>order - sorting order, which is either ASC (ascending) or DESC (descending)</li>\r\n				</ul>\r\n			</td>\r\n			<td style=\"text-align: left; vertical-align: baseline;\">GET</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>Example - Request</h3>\r\n<pre>https://api.enterprise.apigee.com/v1/o/myorg/environments/prod/analytics/stats/default/apis?select=messagecount&amp;timeRange=1/20/201200:00~1/30/2012 00:00&amp;timeUnit=hour&amp;sortby=messagecount&amp;sort=DESC\r\n\r\n</pre>\r\n<h3>Request parameters</h3>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 708px; \">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">Parameter</th>\r\n			<th scope=\"col\">Type</th>\r\n			<th scope=\"col\">Description</th>\r\n			<th scope=\"col\">Default</th>\r\n			<th scope=\"col\">Required</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>metric</td>\r\n			<td>String</td>\r\n			<td>messagecount - total messages including conditions. Example, <em>timeRange</em><br>\r\n				errorcount - total number of errors including conditions. Example, <em>timeRange</em><br>\r\n				resptime - average response time in a given <em>timeRange</em><br>\r\n				maxresptime - maximum response time in a given <em>timeRange</em><br>\r\n				minresptime - minimum response time in a given <em>timeRange</em><br>\r\n				dataexchangesize - total required size in<em>timeRange</em><br>\r\n				endpointresptime - average end point response time in <em>timeRange</em></td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>time unit</td>\r\n			<td>Long</td>\r\n			<td>second<br>\r\n				minute<br>\r\n				hour<br>\r\n				day<br>\r\n				week<br>\r\n				month<br>\r\n				quarter<br>\r\n				year<br>\r\n				decade<br>\r\n				century<br>\r\n				millennium</td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>order</td>\r\n			<td>String</td>\r\n			<td>Categorize the report by arranging them in either ASC (ascending) or DESC (descending) order.</td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>Example - Response</h3>\r\n<p>The HTTP Response Code 2xx displays this success message.</p>\r\n<pre>Success 200 with proper response\r\n{\r\n&nbsp;&nbsp; \"Response\" : {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"TimeUnit\" : [1330074000000,1330092000000,1330084800000],\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"stats\" : {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"data\" : [\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"identifier\" : {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"names\" : \"apiproxy\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"values\" : \"api1\"\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; },\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"metric\" : [{\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"env\" : \"qa\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"name\" : \"messagecount\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"values\" : [17,10,1]\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; },\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"env\" : \"qa\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"name\" : \"messagecount\"\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }