qa\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"name\" : \"messagecount\"\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; },\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"env\" : \"qa\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"name\" : \"messagecount\",\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"values\" : 28\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }]\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ]\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; }\r\n&nbsp;&nbsp; }\r\n}</pre>\r\n<h3>Response parameters</h3>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 708px; \">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\" style=\"text-align: left; vertical-align: top; \">Parameter</th>\r\n			<th scope=\"col\" style=\"text-align: left; vertical-align: top; \">Type</th>\r\n			<th scope=\"col\" style=\"text-align: left; vertical-align: top; \">Description</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr></tr>\r\n		<tr></tr>\r\n		<tr>\r\n			<td>TimeUnit</td>\r\n			<td>String</td>\r\n			<td>Displays&nbsp;individual time values for the data captured</td>\r\n		</tr>\r\n		<tr>\r\n			<td>identifier</td>\r\n			<td>String</td>\r\n			<td>Displays the dimension(s) for which a response is required in terms of name and value</td>\r\n		</tr>\r\n		<tr>\r\n			<td>metric</td>\r\n			<td>String</td>\r\n			<td>Displays the metric/measures which are queried for in a selected expression</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h2><a class=\"jumplink\" name=\"Getting details for top APIs\"></a>Getting details for top APIs</h2>\r\n<p>Use the <span style=\"font-family:courier new,courier,monospace;\">GET</span> method to view the first five top ranked apps with the highest number of active end users (app end users with throughput) in the last 24 hours. The graph lists the average daily throughput for these top APIs over the last 30 days for a given customer in a specific organization and environment.</p>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" dir=\"ltr\" style=\"height: 214px; width: 708px;\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">URI</th>\r\n			<th scope=\"col\">HTTP method</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<p>GET https://api.enterprise.apigee.com/v1/o/{myorg}/environments/{envname}/analytics/stats/default/apis?select={metrics}&amp;timeRange={startDate~endDate}&amp;timeUnit={unit}&amp;sortby={metrics}&amp;sort={order}</p>\r\n				<p>where:</p>\r\n				<ul>\r\n					<li>organizations - name of the organization</li>\r\n					<li>environments - name of the environment</li>\r\n					<li>default - indicates the wireframe report supported out of the box</li>\r\n					<li>apis - the namespace to indicate API based requests&nbsp;</li>\r\n					<li>select - choose the required metrics<br>\r\n						timeRange - the start and end date (mm/dd/yyyy hh:mm)<br>\r\n						timeUnit - indicates the interval by which the response data is grouped by<br>\r\n						sortby - column to sort by<br>\r\n						sort - categorize the report by arranging them in either ascending or descending<br>\r\n						order - sorting order, which is either ASC (ascending) or DESC (descending)</li>\r\n				</ul>\r\n			</td>\r\n			<td style=\"text-align: left; vertical-align: baseline;\">GET</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>Example - Request</h3>\r\n<pre>https://api.enterprise.apigee.com/v1/o/myorg/environments/prod/analytics/stats/default/apis?select=messagecount&amp;timeRange=1/20/2012 00:00~1/30/2012 00:00&amp;timeUnit=hour&amp;sortby=messagecount&amp;sort=DESC&amp;topk=5 \r\n\r\n</pre>\r\n<h3>Request parameters</h3>\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 708px; \">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\">Parameter</th>\r\n			<th scope=\"col\">Type</th>\r\n			<th scope=\"col\">Description</th>\r\n			<th scope=\"col\">Default</th>\r\n			<th scope=\"col\">Required</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>metric</td>\r\n			<td>String</td>\r\n			<td>messagecount - total messages including conditions. Example, <em>timeRange</em><br>\r\n				errorcount - total number of errors including conditions. Example, <em>timeRange</em><br>\r\n				resptime - average response time in a given <em>timeRange</em><br>\r\n				maxresptime - maximum response time in a given <em>timeRange</em><br>\r\n				minresptime - minimum response time in a given <em>timeRange</em><br>\r\n				dataexchangesize - total required size in&nbsp;<em>timeRange</em><br>\r\n				endpointresptime - average end point response time in <em>timeRange</em></td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>time unit</td>\r\n			<td>Long</td>\r\n			<td>second<br>\r\n				minute<br>\r\n				hour<br>\r\n				day<br>\r\n				week<br>\r\n				month<br>\r\n				quarter<br>\r\n				year<br>\r\n				decade<br>\r\n				century<br>\r\n				millennium</td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n		<tr>\r\n			<td>order</td>\r\n			<td>String</td>\r\n			<td>Categorize the report by arranging them in either ASC (ascending) or DESC (descending) order.</td>\r\n			<td>N/A</td>\r\n			<td>Yes</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3>Example - Response</h3>\r\n<p>The HTTP Response Code 2xx displays this success message.</p>\r\n<pre>Success 200 with proper response :\r\n{\r\n&nbsp;&nbsp; \"Response\" : {\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"TimeUnit\" : [1330074000000,1330092000000,1330084800000],\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;